import './Home.css';
import HeroPage from '../../fractions/hero-page/HeroPage';
import thumbnails from '../../../images/thumbnails/thumbnail-1.png';

const Home = () => {
  return (
    <>
      <section id='home' className='container home'>
        <HeroPage thumbnails={thumbnails} />
        <div className='container blog-text'>
          <h1>5 top golang framework</h1>
          <span></span>
          <p>
            Framework adalah sebuah kerangka kerja yang digunakan
            untuk mengembangkan website. Framework ini diciptakan
            untuk membantu...
          </p>
        </div>
      </section>
    </>
  )
}

export default Home;
